                "ingredients": "‎Water, Cetyl Alcohol, Behentrimonium Chloride, Glycerin, Dimethicone, Parfum,nParaffinum Liquidum, Stearamidopropyl Dimethylamine, Isopropyl Alcohol, DMDM Hydantoin, Lactic Acid, Hydroxyethylcellulose, Benzophenone-3, Panthenol, Stearyl Alcohol, BHT, 2-Bromo–2-Nitropropane–1,3-Diol, Myristyl Alcohol, Disodium Phosphate, Hydrated Silica, Sodium Phosphate, Polysorbate 60, Lauryl Alcohol, CI 17200, Vaccinium Macrocarpon (Cranberry) Fruit Juice, Vaccinium Myrtillus (Bilberry) Fruit Extract, CI 42090, Sodium Benzoate, Potassium Sorbate, Coumarin, Eugenol, Hexyl Cinnamal, Linalool, Alpha-Isomethyl Ionone, Citronellol, Geraniol.n",
                "direction": "מורחים על שיער חפוף ונקי לכל אורכו ושוטפים היטב במים. להגברת התוצאות מומלץ להשלים את טיפוח השיער עם שמפו נקה 7.",
