                "remarkToCustomer": "הנתונים המדויקים מופיעים על גבי המוצר שבחנות. אין להסתמך על הפירוט המופיע באתר, nיתכנו אי התאמות בין הנתונים המופיעים באתר למוצר שבחנות . nיש לקרוא ולהסתמך רק על התווית המופיעה על גבי אריזת המוצר שבחנות לפני השימוש  .nהתמונות והתאריכים המופיעים באתר הינם להמחשה בלבד ואין להסתמך עליהם.nnn"
